import React from "react";

class DetailPost extends React.Component {
  render() {
    {
      this.props.posts.posts.map((item, index) => {
        return (
          <div>
            <div onClick={() => this.props.showPost(item.id)}>
              <Post
                id={item.id}
                key={index}
                item={item}
                deleteHandaler={() => this.deleteHandaler}
              />
            </div>
          </div>
        );
      });
    }
  }
}

export default DetailPost;
